test = True


def get_nonce():
    if not test:
        html = request.urlopen(nonce_url).read()
        soup = BeautifulSoup(html, 'html.parser')

        head = soup.find("head")
        for navstr in head(text=True):
            CDATA_in_parts = str(navstr).split("\"")
            for idx, part in enumerate(CDATA_in_parts):
                if part == "nonce":
                    return CDATA_in_parts[idx + 2]
    else:
        return ""


